/**
@author:- Anurag
@email:- anurag@c3ihub.iitk.ac.in

UserStorage contract is used to map user id to voter and candidate address, and to manage election verifier, approver.
The contract owner and admin have the authority to update voter, candidate, verifier, approver.

*/

// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.16;

import "./DataTypes.sol";
import "./VotingCommon.sol";

contract UserStorage is VotingCommon {

    // Mapping for User
    mapping(bytes32 => address) public userMap;
    mapping(address => bytes32) public userReverseMap;

    // Mapping for voter 
    mapping(bytes32 => Voter) public voterMap; // voter id => voter detail object
    mapping(bytes32 => address) public voterAddressMap; // voter id => voter address
    mapping(address => bytes32) public voterReverseMap; // address => id

    // Mapping for candidate
    mapping(bytes32 => Candidate) public candidateMap; // candidate id => candidate detail object
    mapping(bytes32 => address) public candidateAddressMap; // candidate id => candidate address
    mapping(address => bytes32) public candidateReverseMap; // address => id

    // Mapping for Election officer members
    mapping(bytes32 => Member) public memberMap; // member id => member object
    mapping(bytes32 => address) public memberAddressMap; // member id => address
    mapping(address => bytes32) public memberReverseMap; // address => id

    // Event emtted after a user added
    event UserAdded(bytes32 userId, address userAddress);
    event UserUpdated(bytes32 userId, address userAddress);
    event UserDeleted(bytes32 userId, address userAddress);

    // Event emmited after a voter added
    event VoterAdded(bytes32 voterId, address voterAddress);
    // Event emmited after a voter updated
    event VoterUpdated(Voter voter, address voterAddress);
    // Event emmited after a voter deleted
    event VoterDeleted(bytes32 voterId);

    // Event emmited after a candidate added
    event CandidateAdded(Candidate candidate, address candidateAddress);
    // Ememt emmited after a candidate update
    event CandidateUpdated(Candidate candidate, address candidateAddress);
    // Ememt emmited after a candidate deleted
    event CandidateDeleted(bytes32 candidateId);

    // Event emmited after a member added
    event MemberAdded(Member member, address memberAddress);
    // Event emmited after a member updated
    event MemberUpdated(Member member, address memberAddress);
    // Event emmited after a member deleted
    event MemberDeleted(bytes32 memberId);

    // constructor to set the initial state of the contract
    constructor(
        address _admin,
        address _manager
    ) VotingCommon(_admin, _manager) {}

/*
     * @dev Function to add a user
 * @param userId 12 bit uint id of the user
 * @param userAddress address of the user
 */
     function addUser(bytes32 userId, address userAddress) public  {
        // check is user already does not exist
        if(userMap[userId]!=address(0)){
            revert("User already exists, instead try updating the address");
        }
        // Update the user in the mapping
        userMap[userId] = userAddress;
        userReverseMap[userAddress]=userId;

        // Emit the UserAdded event
